// src/components/Skills.js
import React from 'react';
import {
  SiPython,
  SiPytorch,
  SiTensorflow,
  SiDocker,
  SiGit,
  SiLinux,
  SiMysql,
  SiWeightsandbiases,
  SiNumpy,
  SiPandas,
  SiScikitlearn,
  SiOpencv
} from 'react-icons/si';
import { FaAws, FaBrain } from 'react-icons/fa';
import { RiLinksFill } from 'react-icons/ri';
import { GiArtificialIntelligence } from 'react-icons/gi';
import { AiOutlineCluster } from 'react-icons/ai';

// Skills grouped by category
const skillCategories = [
  {
    title: 'Programming & ML Frameworks',
    skills: [
      { name: 'Python', icon: <SiPython className="text-yellow-500" /> },
      { name: 'PyTorch', icon: <SiPytorch className="text-red-500" /> },
      { name: 'TensorFlow', icon: <SiTensorflow className="text-orange-500" /> },
      { name: 'Scikit-learn', icon: <SiScikitlearn className="text-blue-500" /> },
      { name: 'OpenCV', icon: <SiOpencv className="text-green-500" /> },
      { name: 'NumPy', icon: <SiNumpy className="text-blue-400" /> },
      { name: 'Pandas', icon: <SiPandas className="text-indigo-500" /> }
    ]
  },
  {
    title: 'MLOps & Infrastructure',
    skills: [
      { name: 'Docker', icon: <SiDocker className="text-blue-500" /> },
      { name: 'Linux', icon: <SiLinux className="text-gray-700" /> },
      { name: 'AWS', icon: <FaAws className="text-orange-400" /> },
      { name: 'Git', icon: <SiGit className="text-red-600" /> },
      { name: 'SQL', icon: <SiMysql className="text-blue-600" /> },
      { name: 'Weights & Biases', icon: <SiWeightsandbiases className="text-yellow-600" /> }
    ]
  },
  {
    title: 'Advanced Techniques',
    skills: [
      { name: 'LangChain', icon: <RiLinksFill className="text-purple-500" /> },
      { name: 'LangGraph', icon: <AiOutlineCluster className="text-teal-500" /> },
      { name: 'ONNX', icon: <GiArtificialIntelligence className="text-indigo-600" /> },
      { name: 'Knowledge Distillation', icon: <FaBrain className="text-pink-500" /> },
      { name: 'Pruning', icon: <FaBrain className="text-green-500" /> },
      { name: 'Quantization', icon: <FaBrain className="text-blue-500" /> }
    ]
  }
];

const Skills = ({ isVisible }) => {
  return (
    <section
      id="skills"
      className={`section-padding bg-white dark:bg-gray-900 transition-all duration-700 ${
        isVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-10'
      }`}
    >
      <div className="container mx-auto px-4">
        <h2 className="section-title">Technical Skills</h2>
        <p className="text-center text-gray-600 dark:text-gray-300 mb-16 max-w-3xl mx-auto">
          Expertise across Machine Learning, MLOps, and Advanced AI techniques
        </p>

        <div className="space-y-12">
          {skillCategories.map((category, idx) => (
            <div key={idx}>
              <h3 className="text-xl font-bold text-primary-600 dark:text-primary-400 mb-6">
                {category.title}
              </h3>
              <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
                {category.skills.map((skill, index) => (
                  <div
                    key={index}
                    className="card flex flex-col items-center p-6 text-center hover:scale-105 transition-transform duration-300"
                  >
                    <div className="text-4xl mb-4">{skill.icon}</div>
                    <h4 className="font-semibold text-lg">{skill.name}</h4>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
